  const map = new Map()

  const BranchValues = [...Branch1, ...Branch2]
  console.log(BranchValues)

  function sortOn(property) {
    return function (a, b) {
      if (a[property] < b[property]) {
        return -1
      } else if (a[property] > b[property]) {
        return 1
      } else {
        return 0
      }
    }
  }

  BranchValues.sort(sortOn('name'))

  let reducedObjArr = Object.values(
    BranchValues.reduce((acc, curr) => {
      ;(acc[curr.name] = acc[curr.name] || {
        name: curr.name,
        id: curr.id,
        unitPrice: curr.unitPrice,
        sold: 0,
      }).sold += curr.sold
      return acc
    }, {})
  )

  function search(rows) {
    return rows.filter(
      (row) => row.name.toString().toLowerCase().toLowerCasetoString().indexOf(query.toString().toLowerCase()) > -1
    )
  }

  return (
    <div className="product-list">
      <div>
        <label>Search Products</label>
        <input
          type="text"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
        />
      </div>
      <div>
        <Datatable data={search(reducedObjArr)} />
      </div>
    </div>
  )
}

